import React, { useContext } from 'react';
import Loading from './Loading';
import PlanetsContext from '../context/PlanetsContext';

function Table(props) {
  const { loading } = useContext(PlanetsContext);
  if(loading)
    return <Loading />;
  return (
    <h1>Table</h1>
  );
}

export default Table;
